import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'Tutorial'
  today = new Date()
  lastMonth = new Date('2023/08/04')
}
<app-nav></app-nav>

{{ today | timeAgo }} <br>
{{ lastMonth | timeAgo }}

<app-productlist></app-productlist>
